import './Sidebar.css';

import ComingSoon from './ComingSoon.js';
function Alert(){


return(
    <div >
<a href='./ComingSoon.js'>
<img id="alert" className="alert" src={NotConnect}/>

</a>

    </div>

);


}



export default Alert;
